/*Table structure for table `orderlist` */

DROP TABLE IF EXISTS `orderlist`;

CREATE TABLE `orderlist` (
  `id` int NOT NULL AUTO_INCREMENT,
  `cemail` varchar(25) DEFAULT NULL,
