/*Table structure for table `rew` */

DROP TABLE IF EXISTS `rew`;

CREATE TABLE `rew` (
  `id` int NOT NULL AUTO_INCREMENT,
  `cemail` varchar(25) DEFAULT NULL,
  `demail` varchar(25) DEFAULT NULL,
  `review` varchar(500) DEFAULT NULL,
