/*Table structure for table `vp` */

DROP TABLE IF EXISTS `vp`;

CREATE TABLE `vp` (
  `id` int NOT NULL AUTO_INCREMENT,
  `email` varchar(20) DEFAULT NULL,
  `dp` varchar(20) DEFAULT NULL,
  `milktype` varchar(10) DEFAULT NULL,
  `qp` varchar(20) DEFAULT NULL,
  `storage` varchar(20) DEFAULT NULL,
  `mfg` date DEFAULT NULL,
  `exp` date DEFAULT NULL,
  `contains` varchar(500) DEFAULT NULL,
  `cost` bigint DEFAULT NULL,
  `discount` int DEFAULT NULL,
  `typee` varchar(10) DEFAULT NULL,
  `image` longblob,
  `descr` varchar(500) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

